import React from 'react';
import GroupsView from './components/GroupsView';
import Catalog from './components/CatalogView';
import Home from './components/Home';
import NavView from './components/NavView';
import DashboardView from './components/DashboardView';
import SignIn from './components/SignIn';
import { Provider } from "react-redux";
import store from "./store/js/index";
import { SecureRoute, Security, LoginCallback } from '@okta/okta-react';


import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
  useHistory
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Provider store={store}>
        <Security issuer='https://dev-236245.okta.com/oauth2/default'
          clientId='0oaa16u5xbybQbAZX4x6'
          redirectUri={window.location.origin + '/implicit/callback'} >
          <div className="" id="nav-view">
            <NavView />
          </div>
          <Switch>
            <Route path="/foodcommune/catalog"><Catalog /></Route>
            <Route path="/foodcommune/groups"><GroupsView /></Route>
            <PrivateRoute path="/foodcommune/dashboard">
              <DashboardView />
            </PrivateRoute>
            <Route path="/foodcommune/signin"><SignIn /></Route>
            <Route path="/foodcommune"><Home /></Route>
          </Switch>
        </Security>
      </Provider>

    </Router>
  );
}

export default App;

// If user is not signed in redired to home page
function PrivateRoute({ children, path }) {
  let state = store.getState();
  console.log(path)
  console.log("STORE", store.getState())
  let auth = store.token && store.user ? true : false;

  return auth ? (children) : (<Route>
    <Redirect to={{ pathname: "/foodcommune/signin" }} />
  </Route>)
}
